import React, { useEffect, useState } from 'react'

const Home = () => {
    const [items, setItems] = useState([])
    useEffect(() => {
        fetch('http://localhost:3001/products')
            .then(response => response.json())
            .then(data => setItems(data))
    }, [])
    return (
        <div>
            {items.map(item => ((
                <div key={item.id}>
                    <h2>{item.product_name}</h2>
                </div>
            )))}
        </div>
    )
}

export default Home
